import './About.css';

function About() {
    return(
        <div className='about' id='about'>
        <div className='container'>
            <h2 className='title'>Giới thiệu</h2>
            <p className='content'>Em đang là sinh viên năm 3, ngành Công Nghệ Thông tin. Áp dụng những kiến thức và những kỹ năng đã có và đã học phục vụ cho công ty và khách hàng trong thời gian làm việc.Với kỹ năng nhanh nhẹn, dễ thích nghi với môi trường mới, tôi có thể học tập và áp dụng vào công việc trong 1-2 tháng làm việc. Những dự định tương lại của tôi là trở thành Junior Front End Developer trong 2- 3 năm tới, và Senior Front End Developer trong 3-4 năm tới.</p>
        </div>
        </div>
    );
}

export default About;
